import './App.css';
import Home from './components/Home';
import Details from './components/Details';
import { BrowserRouter, Route } from 'react-router-dom'

function App() {
  return (
    <div>
    <BrowserRouter>
      <Route exact path='/' component={Home}/>
      <Route exact path='/details' component={Details}/>
    </BrowserRouter>
    </div>
   
  );
}

export default App;
